import React, { useState } from "react";
import Board from "./Board";

function Game() {
  const [startGame, setStartGame] = useState(false);

  return (
    <div>
      {startGame ? (
        <Board />
      ) : (
        <button onClick={() => setStartGame(true)}>Start Game</button>
      )}
    </div>
  );
}

export default Game;
